import { useState } from "react"

const useFetchGifs = () => {

    const [state, setState] = useState({
        data: [],
        loading: true
    })

    setTimeout(() => {
        setState({
            data: [1, 2, 3],
            loading: false
        })
    }, 2500)

    return state; // Retorna el objeto.

}

export default useFetchGifs;
